  \"2015-09-26T20:42:21.385468\",\n\t\"name\": \"meteorological-and-hydrographic-monitoring-data-collected-at-dauphin-island-station-in-alabama-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Meteorological and hydrographic data were
  collected from a monitoring station on Dauphin Island from Nov 1999 to Feb 2001.
  Variables measured include air temperature, barometric pressure, solar and quantum
  radiation, wind speed and direction, water temperature, salinity, dissolved oxygen,
  pH, specific conductance, and water level.nnPurpose: The value of coastal observing
  systems is recognized by the U.S. Congress, the National Ocean Partnership Program,
  the Environmental Protection Agency, and the National Ocean and Atmospheric Administration.
  Recent reports by the Pew Oceans Commission and U.S. Commission on Ocean Policy
  have decried the lack of information from near coastal waters on which to base management
  decisions and recommended monitoring programs linked to strong research. Reasons
  for observations of meteorological and hydrographic parameters include (1) continuous
  characterization of spatial and temporal patterns of change in water quality, (2)
  development of a permanent record of significant and human caused changes in environmental
  indicators over time and (3) support for research activities through the availability
  of consistent, scientifically valid data.nData are archived as part of a long-term
  program monitoring coastal weather conditions and baseline hydrographic conditions.\",\n\t\"license_title\":
